const constNaN = { re: NaN, im: NaN }; //Not a number, i guess
const constInf = { re: Infinity, im: Infinity}; //Better end with this

const cosh = Math.cosh || function (x) {
  return Math.abs(x) < 1e-9 ? 1 - x : (Math.exp(x) + Math.exp(-x)) * 0.5; //Majick
};

const sinh = Math.sinh || function (x) {
  return Math.abs(x) < 1e-9 ? x : (Math.exp(x) - Math.exp(-x)) * 0.5; //Majick 2
};

const Parse = function (a, b) { //Rawify's cool parse function, Complex-es both inputs.
  const z = Zero;
  if (a === undefined || a === null) { 
    z.re = z.im = 0;
  } else if (b !== undefined) {
    z.re = a;
    z.im = b;
  } else switch (typeof a) {

      case 'object':
        if ('re' in a && 'im' in a) {
          z.re = a.re;
          z.im = a.im;
        } else if ('abs' in a && 'arg' in a) {
          if (!isFinite(a['abs']) && isFinite(a['arg'])) {
            return constInf;
          }
          z.re = a['abs'] * Math.cos(a['arg']); //Cool cis trick
          z.im = a['abs'] * Math.sin(a['arg']);
        } else if (a.length === 2) { // Quick array check
          z.re = a[0];
          z.im = a[1];
        } else {
          parser_exit();
        }
        break;

      case 'string':

		if (a == 'Infinity') {
			return constInf
		}
		if (a == 'NaN') {
			return constNaN
		}

        z.im = z.re = 0;
        const tokens = a.replace(/_/g, '')
          .match(/\d+\.?\d*e[+-]?\d+|\d+\.?\d*|\.\d+|./g); //Majick: The match
        let plus = 1;
        let minus = 0;

        if (tokens === null) {
          parser_exit();
        }

        for (let i = 0; i < tokens.length; i++) {

          const c = tokens[i];
          if (c === ' ' || c === '\t' || c === '\n') {
            /* void */;
          } else if (c === '+') {
            plus++;
          } else if (c === '-') {
            minus++;
          } else if (c === 'i' || c === 'I') {

            if (plus + minus === 0) { //What the...?
              parser_exit();
            }

            if (tokens[i + 1] !== ' ' && !isNaN(tokens[i + 1])) {
              z.im += parseFloat((minus % 2 ? '-' : '') + tokens[i + 1]);
              i++;
            } else {
              z.im += parseFloat((minus % 2 ? '-' : '') + '1');
            }
            plus = minus = 0; //Oh I get it

          } else {

            if (plus + minus === 0 || isNaN(c)) {
              parser_exit();
            }

            if (tokens[i + 1] === 'i' || tokens[i + 1] === 'I') {
              z.im += parseFloat((minus % 2 ? '-' : '') + c);
              i++;
            } else {
              z.re += parseFloat((minus % 2 ? '-' : '') + c);
            }
            plus = minus = 0;
          }
        }

        if (plus + minus > 0) {
          parser_exit();
        }
        break;

      case 'number':
        z.re = a; //Let's be real
        z.im = 0;
        break;

      default:
        parser_exit();
    }

  if (isNaN(z.re) || isNaN(z.im)) {
    return constNaN; /* If it's NaN, it's NaN*/
  }

  return z;
};

const isitNaN = function (C) {
    return isNaN(C.re) || isNaN(C.im);
};
const isitFin = function (C) {
    return isFinite(C.re) || isFinite(C.im);
};

const hypot = function (x, y) {

  x = Math.abs(x);
  y = Math.abs(y);

  if (x < y) [x, y] = [y, x]; //x wanna be bigger

  if (x < 1e8) return Math.sqrt(x * x + y * y); //When smol enough, clasic

  y /= x; //When big enough, workaround
  return x * Math.sqrt(1 + y * y); //We don't want overflow
};
const logHypot = function (a, b) {

  const _a = Math.abs(a);
  const _b = Math.abs(b);

  if (a === 0) {
    return Math.log(_b);
  }

  if (b === 0) {
    return Math.log(_a);
  }

  if (_a < 3000 && _b < 3000) {
    return Math.log(a * a + b * b) * 0.5;
  }

  /* 
    Cool unsued function:
   const fn = function(a, b) {
   a = Math.abs(a);
   b = Math.abs(b);
   let t = Math.min(a, b);
   a = Math.max(a, b);
   t = t / a;

   return Math.log(a) + Math.log(1 + t * t) / 2;
   };

   */

  a = a * 0.5;
  b = b * 0.5;

  return 0.5 * Math.log(a * a + b * b) + Math.LN2;
};

const toString = function (x) {
	
    if (isitNaN(x)) {
      return 'NaN';
    }
    if (!isitFin(x)) {
      return 'Infinity';
    }

    let a = x.re;
    let b = x.im;
    let ret = "";

    if (Math.abs(a) < 1e-15) { //When too small
      a = 0;
    }
    if (Math.abs(b) < 1e-15) {
      b = 0;
    }

    if (b === 0) { //When x real
      return ret + a;
    }

    if (a !== 0) {
      ret += a;
      if (b < 0) {
        b = -b;
        ret += "-";
      } else {
        ret += "+";
      }
    } else if (b < 0) {
      b = -b;
      ret += "-";
    }

    if (1 !== b) { // We don't want 1i :|
      ret += b;
    }
    return ret + "i";
  };

